CREATE DATABASE streets_db;
USE streets_db;

CREATE TABLE newreleases (
  album_type VARCHAR(200),
  name VARCHAR(200),
  external_urls json DEFAULT NULL,
  release_date VARCHAR(200),
  uri VARCHAR(200),
  total_tracks int(11) DEFAULT NULL,
  href VARCHAR(200),
  artists json DEFAULT NULL,
  images json DEFAULT NULL,
  type VARCHAR(200),
  id VARCHAR(200),
  available_markets json DEFAULT NULL,
  release_date_precision VARCHAR(200),
  PRIMARY KEY (id)
);



SELECT * FROM newreleases;